  await axios.post("http://localhost:1337/addUser", data).then(
    (response) => {
      if (response.data.code == "E_UNIQUE") {
        msg = "email already exist";

        console.log(msg);
      } else {
        console.log(response);
        msg = "Sucessfully Registered";
      }
      //   console.log(response);
      //   return response;
    },
    (error) => {
      console.log(error);
    }
  );
  return msg;
}

